import React, {Component} from "react";
import './tabata.css';
import Exercise from "./components/exercise";

class Tabata extends Component {
    render() {
        return (
            <div className="col-3">
             <Exercise/>
             <div className="col-3 align-self-center">
                 <h2>Ejercicio</h2>
             </div>
            </div>
        );
    }
}
export default Tabata;
